import styled from "styled-components";

const lightTheme = {};

const darkTheme = {};

const media = {
  mobile: "@media(max-width:600px)",
};

export const LogModalWrap = styled.div`
  display: flex;
  z-index: 10;
  position: fixed;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;
  width: 100%;
  height: 100%;
  overflow: auto;
  background: rgba(0, 0, 0, 0.6);

  .container {
    background: #ffffff;
    width: 30%;
    margin: auto;
  }
`;
